class Digit
{
public:
	double S;
	int Xl,Xr,Yl,Yh;
	int * digit;
	int label;
	Digit(int l)
	{
		label = l;
		Xr = Yl = 0;
		Xl = Yh = 32000;
		S = 0;
		digit = new int[600];
	}

	~Digit()
	{
		delete[] digit;
	}
};

class DisjointSets
{
public:

	// Create an empty DisjointSets data structure
	DisjointSets()
	{
		m_numElements = 0;
		m_numSets = 0;
	};
	// Create a DisjointSets data structure with a specified number of elements (with element id's from 0 to count-1)
	DisjointSets(int count)
	{
		m_numElements = 0;
		m_numSets = 0;
		AddElements(count);
	};
	// Copy constructor
	DisjointSets(const DisjointSets & s)
	{
		this->m_numElements = s.m_numElements;
		this->m_numSets = s.m_numSets;

		// Copy nodes
		m_nodes.resize(m_numElements);
		for(int i = 0; i < m_numElements; ++i)
			m_nodes[i] = new Node(*s.m_nodes[i]);

		// Update parent pointers to point to newly created nodes rather than the old ones
		for(int i = 0; i < m_numElements; ++i)
			if(m_nodes[i]->parent != NULL)
				m_nodes[i]->parent = m_nodes[s.m_nodes[i]->parent->index];
	};
	// Destructor
	~DisjointSets()
	{
		for(int i = 0; i < m_numElements; ++i)
			delete m_nodes[i];
		m_nodes.clear();
		m_numElements = 0;
		m_numSets = 0;
	};

	// Find the set identifier that an element currently belongs to.
	// Note: some internal data is modified for optimization even though this method is consant.
	int FindSet(int elementId) const
	{
		--elementId;
		assert(elementId < m_numElements);

		Node* curNode;

		// Find the root element that represents the set which `elementId` belongs to
		curNode = m_nodes[elementId];
		while(curNode->parent != NULL)
			curNode = curNode->parent;
		Node* root = curNode;

		// Walk to the root, updating the parents of `elementId`. Make those elements the direct
		// children of `root`. This optimizes the tree for future FindSet invokations.
		curNode = m_nodes[elementId];
		while(curNode != root)
		{
			Node* next = curNode->parent;
			curNode->parent = root;
			curNode = next;
		}

		return root->index;
	}
	// Combine two sets into one. All elements in those two sets will share the same set id that can be gotten using FindSet.
	void Union(int setId1, int setId2)
	{
		assert(setId1 < m_numElements);
		assert(setId2 < m_numElements);

		if(setId1 == setId2)
			return; // already unioned

		Node* set1 = m_nodes[setId1];
		Node* set2 = m_nodes[setId2];

		// Determine which node representing a set has a higher rank. The node with the higher rank is
		// likely to have a bigger subtree so in order to better balance the tree representing the
		// union, the node with the higher rank is made the parent of the one with the lower rank and
		// not the other way around.
		if(set1->rank > set2->rank)
			set2->parent = set1;
		else if(set1->rank < set2->rank)
			set1->parent = set2;
		else // set1->rank == set2->rank
		{
			set2->parent = set1;
			++set1->rank; // update rank
		}

		// Since two sets have fused into one, there is now one less set so update the set count.
		--m_numSets;
	}
	
	// Add a specified number of elements to the DisjointSets data structure. The element id's of the new elements are numbered
	// consequitively starting with the first never-before-used elementId.
	void AddElements(int numToAdd)
	{
		assert(numToAdd >= 0);

		// insert and initialize the specified number of element nodes to the end of the `m_nodes` array
		m_nodes.insert(m_nodes.end(), numToAdd, (Node*)NULL);
		for(int i = m_numElements; i < m_numElements + numToAdd; ++i)
		{
			m_nodes[i] = new Node();
			m_nodes[i]->parent = NULL;
			m_nodes[i]->index = i;
			m_nodes[i]->rank = 0;
		}

		// update element and set counts
		m_numElements += numToAdd;
		m_numSets += numToAdd;
	}
	// Returns the number of elements currently in the DisjointSets data structure.
	int NumElements() const
	{
		return m_numElements;
	}
	// Returns the number of sets currently in the DisjointSets data structure.
	int NumSets() const
	{
		return m_numSets;
	}

private:

	// Internal Node data structure used for representing an element
	struct Node
	{
		int rank; // This roughly represent the max height of the node in its subtree
		int index; // The index of the element the node represents
		Node* parent; // The parent node of the node
	};

	int m_numElements; // the number of elements currently in the DisjointSets data structure.
	int m_numSets; // the number of sets currently in the DisjointSets data structure.
	std::vector<Node*> m_nodes; // the list of nodes representing the elements
};


/**
  *    
 */
class Neuron
{
public:
	/**
	  * 
	  * @param c -  
	 */
	Neuron(int c)
	{
		count = c;
		w = new double[count];
	}

	~Neuron()
	{
		delete[] w;
	}

	/**
	  *  
	  * @param x -  
	  * @return -   
	 */
	double tranfer(int *x)
	{
		return activator(sum(x));
	}

	/**
	  *     
	 */
	void getWeights(double *weight)
	{

		for (int i = 0; i < count; i++)
		{
			w[i] = weight[i];
		}
	}

	double * getW()
	{
		return w;
	}

private:
	double* w; //  
	int count; //  

	/**
	  * 
	 */
	double sum(int *x)
	{
		double nec = 0;
		for(int i = 0; i < count; i++)
		{
			nec += x[i]*w[i];
		}
		return nec;
	}

	 /**
	   *     ,
	   *    -   ,
	   *    {0;1}
	  */
	double activator(double nec)
	{
		return 1/(1 + exp(-nec));
	}
};

 /**
   *  n- 
 */
class Perceptron
{
public:
	 /**
	   * 
	   * @param n -  
	   * @param m -      
	  */
	Perceptron(int n, int m)
	{
		this->n = n;
		this->m = m;
		neurons.insert(neurons.end(), n, (Neuron*)NULL);
		for (int j = 0; j <n; j++)
		{
			neurons[j] = new Neuron(m);
		}
	}

	 /**
	   * 
	  */
	~Perceptron()
	{
		for(int i = 0; i < n; ++i)
			delete neurons[i];
		neurons.clear();
	}


	 /**
	   *  
	   * @param x -  
	   * @param y -  
	  */
	void recognize(int *x, double *y)
	{
		for( int j = 0; j < n; j++)
		{
			y[j] = neurons[j]->tranfer(x);
		}
	}

	  /**
	*    
	   */
	void getWeights(double *weight)
	{
		for(int j = 0; j < n; j++)
		{
			neurons[j]->getWeights(&weight[j*m]);
		}
	}

	int getN()
	{
		return n;
	}

	int getM()
	{
		return m;
	}

private:
	std::vector<Neuron*> neurons;
	int n,m;
};

/**
 *	     
 *	   
 */
class SeqScan
{
public:
	/**
	*	 
	*/
	SeqScan(int row, int column)
	{
		row_count = row;
		column_count = column;
		labeledMap = new int[row_count*column_count];
		memset(labeledMap, 0, 4*(row_count*column_count));
		label = 0;
	}

	/**
	  *  
	*/
	~SeqScan()
	{
		delete[] labeledMap;
	}

	/**
	  *    
	*/
	void PostProcessing()
	{
		for (int i = 1; i < row_count; i++)
		{
			for (int j = 1; j < column_count; j++)
			{
				if (labeledMap[i*column_count + j] != 0)
					labeledMap[i*column_count + j] = conflict.FindSet(labeledMap[i*column_count + j]) + 1;
			}
		}
	}
	
	/**
	  *   
	*/
	void getDigits()
	{
		map<int, Digit*> reg;
		vector<int> toDelete;
		int count = 0;
		for (int j = 1; j < column_count; j++)
		{
			for (int i = 1; i < row_count; i++)
			{
				if (labeledMap[i*column_count + j] != 0)
				{
					if (reg.find(labeledMap[i*column_count + j]) == reg.end())
					{
						reg[labeledMap[i*column_count + j]] = new Digit(labeledMap[i*column_count + j]);
						Lcount.push_back(reg[labeledMap[i*column_count + j]]);
						count++;
					}
					if (reg[labeledMap[i*column_count + j]]->Xr < j)
						reg[labeledMap[i*column_count + j]]->Xr = j;
					if (reg[labeledMap[i*column_count + j]]->Xl > j)
						reg[labeledMap[i*column_count + j]]->Xl = j;
					if (reg[labeledMap[i*column_count + j]]->Yl < i)
						reg[labeledMap[i*column_count + j]]->Yl = i;
					if (reg[labeledMap[i*column_count + j]]->Yh > i)
						reg[labeledMap[i*column_count + j]]->Yh = i;
					reg[labeledMap[i*column_count + j]]->S++;
				}
			}
		} 
		for (int i = 0; i < count; i++)
		{
			//       10 
			if (Lcount[i]->S < 20)
				toDelete.push_back(i);
			else
			{
				int c = 0;
				double height = (Lcount[i]->Yl - Lcount[i]->Yh) / 29.0;
				double width = (Lcount[i]->Xr  - Lcount[i]->Xl) / 19.0;

				for(int k = 0; k < 30; k++)
				{
					for(int j = 0; j < 20; j++)
					{
						if (labeledMap[(int)floor(k*height + 0.5)* column_count  + (int)floor(j*width + 0.5) +
								Lcount[i]->Yh*column_count + Lcount[i]->Xl] == Lcount[i]->label)
						{
							Lcount[i]->digit[k*20 + j] = 1;
							c++;
						}
						else
							Lcount[i]->digit[k*20 + j] = 0;
					}
				}
				if (c < 100)
					toDelete.push_back(i);
			}
		}
		for (int i = toDelete.size() - 1; i >= 0; i--)
		{
			Lcount.erase(Lcount.begin() + toDelete[i]);
		}
	}

	/**
	  *   
	*/
	void Run(char *data)
	{
		for (int i = 1; i < row_count; i++)
		{
			for (int j = 1; j < column_count; j++)
			{
				if (data[i*column_count + j] == '@' || data[i*column_count + j] == '#' || 
					(data[i*column_count + j] == '%' && 
					(labeledMap[i*column_count + j - 1] == 0 && data[i*column_count + j + 1] == '.')))
				{	
					if (labeledMap[(i - 1)*column_count + j-1] != 0)
					{
						labeledMap[i*column_count + j] = labeledMap[(i - 1)*column_count + j - 1];
					}
					else
					{
						if ((labeledMap[(i - 1)*column_count + j] == 0) && (labeledMap[i*column_count + j - 1] == 0))
						{
							label++;
							labeledMap[i*column_count + j] = label;
							conflict.AddElements(1);
						}
						else
						{
							if ((labeledMap[(i - 1)*column_count + j] != 0) ^ (labeledMap[i*column_count + j - 1] != 0))
							{
								if (labeledMap[(i - 1)*column_count + j] != 0)
									labeledMap[i*column_count + j] = labeledMap[(i - 1)*column_count + j];
								else
									labeledMap[i*column_count + j] = labeledMap[i*column_count + j - 1];
							}
							else
							{
								if ((labeledMap[(i - 1)*column_count + j] != 0) && (labeledMap[i*column_count + j - 1] != 0))
								{
									labeledMap[i*column_count + j] = labeledMap[(i - 1)*column_count + j];
									if (labeledMap[(i - 1)*column_count + j] != labeledMap[i*column_count + j - 1])
									{
										conflict.Union(conflict.FindSet(labeledMap[i*column_count + j - 1]), conflict.FindSet(labeledMap[(i - 1)*column_count + j]));								
									}
								}
							}
						}
					}
					if ((labeledMap[(i - 1)*column_count + j+1] != 0) && 
						(labeledMap[(i - 1)*column_count + j+1] != labeledMap[i*column_count + j]) )
					{
						conflict.Union(conflict.FindSet(labeledMap[i*column_count + j]), conflict.FindSet(labeledMap[(i - 1)*column_count + j + 1 ]));								
					}
				}
			}
		}
		PostProcessing();
		getDigits();	
	}
	/**
	 *    .
	*/
	int * getLabeledMap()
	{
		return labeledMap;
	}
	///   
	vector<Digit*> Lcount;
private:
	///     
	int column_count;
	///     
	int	row_count;
	///    
	int* labeledMap;
	///   
	int label;
	///       
	DisjointSets conflict;
};

/**
 *    
 */
class Scanner
{
public:
	/**
	*	 ,
	*	    .
	*/
	Scanner(int ac, char* av[])
	{
		int tmp[100000];
		int i = 0;
		string str;

		getline(cin,str);
		column_count = str.length();

		do
		{
			for (int j = 0; j < column_count; j++)
			{
				tmp[i*column_count + j] = str[j];
			}
			i++;
		}
		while (getline(cin,str) && !str.empty());

		row_count = i;
		data = new char[row_count*column_count];

		for(int i = 0; i < row_count; i++)
		{
			for(int j = 0; j < column_count; j++)
			{
				data[i*column_count + j] = tmp[i*column_count + j];
			}
		}
	}

	/**
	  *  
	*/
	~Scanner()
	{
		delete[] data;
	}

	/**
	  *     .
	*/
	void Run()
	{
		SeqScan labelScan(row_count, column_count);
		labelScan.Run(data);
		int size = 600;
		int n = 10;
		double *z = new double[10];
		Perceptron perceptron(n, size);

		perceptron.getWeights(weights);
		for (vector<Digit*>::const_iterator it = labelScan.Lcount.begin(); it != labelScan.Lcount.end(); it++)
		{
			int number = 0;
			double prec = 0;
			perceptron.recognize((*it)->digit, z);
			for (int k = 0; k < n ; k++)
			{
				if (z[k] > prec)
				{
					prec = z[k];
					number = k;
				}
				//cout << "Number is: " << k << "  " << z[k] << endl;
			}
			cout << number;
		}
		delete[] z;
	}

private:
	///    
	int column_count;
	///    
	int	row_count;
	///    
	char* data;

};


int main(int argc, char* argv[])
{
	try
	{
		Scanner scanner(argc,argv);
		scanner.Run();
	}
	catch(exception& e)
	{
	cerr << "Error: " << e.what() << "\n";
	return 1;
	}
	catch(...)
	{
	cerr << "Exception of unknown type!\n";
	return 2;
	}
	return 0;
}